(5 ,"Airport Lakes Park", "7098 Shadowridge Drive", "Orlando", "FL", "32812", "-81.316002", "28.4606036", "Airport Lakes Park provides both active and passive recreational amenities. Its located just off of SR436 near the Orlando International Airport.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Al Coith Park", "901 Delaney Avenue", "Orlando", "FL", "32806", "-81.3732808", "28.5302908", "Located just to the south of Downtown Orlando, Al Coith Park offers open space and oak-shaded areas.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Albert Park", "2400 Edgewater Drive", "Orlando", "FL", "32804", "-81.3897088", "28.5732562", "Albert Park is located on 2400 Edgewater Drive. The park has a gazebo, picnic tables and other amenities for visitors to enjoy.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Big Tree Park", "930 N Thornton Avenue", "Orlando", "FL", "32803", "-81.3658065", "28.5579581", "Big Tree Park is located on 930 North Thornton Avenue. Likely between 350 and 400 years old, the oldest tree in Orlando is located here.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Bill Frederick Park At Turkey Lake", "3401 South Hiawassee Road", "Orlando", "FL", "32835", "-81.48389209999999", "28.5070975", "Bill Frederick Park covers 183 acres of land alongside Turkey Lake, one of the top-five rated fishing lakes in the state of Florida. The park is designed for nature lovers and provides families, organizations and community groups with several recreational activities and scenic views.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Blankner Field", "2500 South Mills Avenue", "Orlando", "FL", "32806", "-81.3648614", "28.5147308", "Blankner Field is located on 2500 South Mills Avenue. The field has restrooms and water fountains for visitors to use.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Blue Jacket Park", "2501 General Rees Avenue", "Orlando", "FL", "32814", "-81.3398059", "28.5741107", "Blue Jacket Park is a popular site for baseball, soccer and softball. It is home to many events such as fundraising walks, 5k runs, wedding ceremonies, birthday parties and company picnics.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Cady Way Trail", "Cady Way Trail", "Orlando", "FL", "32803", "-81.3152101", "28.5686935", "The Cady Way Trail is located four miles northeast of Downtown Orlando and is one section of a larger regional trail. The Cady Way Trail extends northeast from the Fashion Square Mall through Orange County, connecting to the Cross Seminole Trail.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Callahan Neighborhood Center", "101 North Parramore Avenue", "Orlando", "FL", "32801", "-81.3886567", "28.5443913", "Callahan Neighborhood Center", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Checker Park", "619 S Parramore Avenue", "Orlando", "FL", "32801", "-81.3889447", "28.5353778", "Checker Park is located on 619 South Parramore Avenue.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Cherokee Park", "525 Cherokee Drive", "Orlando", "FL", "32801", "-81.369329", "28.5323922", "Cherokee Park is located on 525 Cherokee Drive. The park has open space and on street parking.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Cherry Tree Park", "2725 E Jackson Street", "Orlando", "FL", "32803", "-81.3481058", "28.5398167", "This neighborhood park is located at the intersection of Primrose Drive and Jackson Street, close to the Orlando Executive Airport. Almost one acre in size, its playground, pavilion, and open space are very popular with neighborhood families. Picnic tables and grills are available in shaded areas and beneath the pavilion.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Citrus Square Neighborhood Center", "5624 Hickey Drive", "Orlando", "FL", "32822", "-81.31249129999999", "28.5020718", "Citrus Square Neighborhood Center", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Clear Lake Park", "2301 29th Street", "Orlando", "FL", "32805", "-81.408267", "28.51487", "Clear Lake Park is located on 2301 29th Street. The park has a playground, fitness station and other amenities for visitors to enjoy.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"College Park Neighborhood Center", "2393 Elizabeth Avenue", "Orlando", "FL", "32804", "-81.38423320000001", "28.5730209", "College Park Neighborhood Center", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"College Park Pool", "2411 Elizabeth Avenue", "Orlando", "FL", "32804", "-81.3845983", "28.5730668", "2411 Elizabeth AvenueOrlando, FL 32804", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Colonel Joe Kittinger Park", "305 S Crystal Lake Drive", "Orlando", "FL", "32803", "-81.3423479", "28.5399013", "Honoring those who served in the Vietnam War, Col. Joe Kittinger Park is home to a refurbished F-4 Phantom aircraft that was used to provide air support during the war. The park also has other amenities such as a fun-filled playground for the littles ones to enjoy.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Colonialtown Neighborhood Center", "1517 Lake Highland Drive", "Orlando", "FL", "32803", "-81.361081", "28.5619094", "Colonialtown Neighborhood Center", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Colonialtown Square Park", "820 N Fern Creek Ave", "Orlando", "FL", "32803", "-81.3605225", "28.5557661", "Colonialtown Square Park is located on 820 North Fern Creek Avenue. The park is home to a lush garden and old shade trees.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Constitution Green", "300 S Summerlin Avenue", "Orlando", "FL", "32801", "-81.3686854", "28.5390428", "Constitution Green is located on 300 South Summerlin Avenue. The park is home to one of the oldest trees in Orlando.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Dartmouth Park", "822 Dartmouth Street", "Orlando", "FL", "32804", "-81.391863", "28.567705", "Dartmouth Park is a quiet oasis in the middle of College Park. Just over 3 acres in size, the park and its playground are popular among neighborhood families for picnics and children?s birthday parties.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Delaney Park", "1055 Delaney Avenue", "Orlando", "FL", "32801", "-81.3717345", "28.5292873", "Delaney Park is one of Orlando?s oldest parks. Originally called Duckworth Park, the name was changed in 1959 to Delaney Park. Delaney Park is 7.25 acres of a blend of oak-shaded areas, ball fields, open space, playgrounds and picnic facilities. Limited parking is available on side streets.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Demetree Park", "650 Santiago Avenue", "Orlando", "FL", "32807", "-81.3186241", "28.5329537", "Demetree Park is a 24.6-acre park encompasses three lakes linked by a system of walks and boardwalks. The boardwalk winds through a wooded area offering a natural environment for walking, bird watching and resting. More developed areas of the park include a fishing pier, playground, picnic areas, tennis court and basketball court.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),        
(5 ,"Dickson Azalea Park", "100 Rosearden Drive", "Orlando", "FL", "32803", "-81.3583314", "28.5443605", "Dickson Azalea Park offers an oasis for those who want to enjoy its shady trees, picturesque landscape, beautiful birds and flowing water.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
(5 ,"Don Dudley Park", "851 Edgewater Drive", "Orlando", "FL", "32804", "-81.3882272", "28.5567615", "Don Dudley Park offers scenic open space and relaxing views.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
