(5 ,"East Lake Park", "10193 Lake District Lane", "Orlando", "FL", "32832", "-81.2318648", "28.4244935", "East Lake Park is located on 10193 Lake District Lane. Following the path around the lake to the east and north, visitors will find park benches offering frequent shady places to rest along a trail great for walking, jogging or cycling.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
