(5 ,"Orlando Wetlands Park", "25155 Wheeler Road", "Christmas", "FL", "32709", "-80.9933896", "28.569518", "The Orlando Wetlands Park is a man-made wetland designed to provide advanced treatment for reclaimed water from the City of Orlando and other local cities. The Park is 1650 acres in size and located in Christmas, Florida. Visitors may enjoy primitive and passive activities at the Park. Hours are sunrise to sunset, 365 days of the year.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
