(5 ,"Park of the Americas", "201 Andes Avenue", "Orlando", "FL", "32807", "-81.31687699999999", "28.541388", "Park of the Americas is located just north of the 408 and west of the Executive Airport. Park amenties include a 12-foot wide, half mile long path, dog Park, shade pavilions, picnic tables, grills, a tot lot with swings, climbers and motion activities geared towards 2-5 year olds and a satellite Commissioner District 2 office offering a meeting place for the community.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2"),
